tsip_dialog.prototype.timer_schedule = function (T, N) {
    this.timer_cancel(N);
    var This = this;

    This[tsk_string_format("o_timer{0}", N)] = setTimeout(function() {
        window[tsk_string_format('__tsip_dialog_{0}_timer_callback', T)](This, This[tsk_string_format("o_timer{0}", N)]);
    }, This[tsk_string_format("i_timer{0}", N)]);
}

